        description = "Evasion bypass attempt detected"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 0F 84 33 CD E8 CE E9 B5 FC FF FF 15 2C A1 97 00 } 
        $pattern1 = { 6A 5B 5A 8B CE E8 25 05 00 00 0F 84 33 FD FF FF 74 07 FF 15 88 A0 97 00 }
        $pattern2 = { 03 C3 5B E8 57 26 00 00 0F 84 33 CD E8 4B 17 00 00 A1 88 85 80 00 FF 15 2C A1 80 00 }

    condition:
        any of them
}

